import React from "react";
import computer from "./images/computer.png";

import "./MainBack.css";

const MainBack = () => {
  return (
    <div className="mainback">
      <div className="main_picture">
        <img className="backpic" src={computer} />
        <div className="motto">
          <div className="row">
            <div className="col-md-12">
              <p>IMPLEMENT</p>
            </div>
          </div>
          <div className="row">
            <div className="col-md-12">
              <p>IDEA</p>
            </div>
            <div className="col-md-12">
              <p>RESULT</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MainBack;
